    false,nt"url": null,nt"notes": "Environmental Assessment (EA) for the renovation
    and attendant modifications to a water control dike on Red Rock Lakes National Wildlife
    Refuge, Montana.  Completion of the project as designed will eliminate existing
    dam safety concerns and permit a higher degree of water management capabilities
    on the Refuge. Flooding of Refuge wetland habitats and trumpeter swan nest flooding
    will be reduced. Downstream flood potentials will be reduced while maintenance of
    established stream flows is assured.  This EA contains structure designs, various
    articles in the appendix of the progress of the project, approved Compatibility
    Statement, Finding of No Significant Impact (FONSI), and the Section 7 Evaluation.",nt"owner_org":
